Catch @brooklynmack5 and me performing Black Swan pas de deux on Saturday to benefit St. Jude Children’s Hospital. My mom used to volunteer for the hospital when I was young and we lived in Memphis.

Posted @withregram • @brooklynmack5 Hey Y'all, long time no see, I know 🙈
Had to get back on here to let y'all know that...

The LifeChance Gala of the Stars which left the Columbia audience spellbound late last spring is back! Featuring some of the world's most talented artists, hailing from all over the world to fundraise for St. Jude Children's Hospital. All of us know someone who has had to battle this disease and know how devastating it can be. St. Jude provides support and medical care to the child and their families, while conducting leading research, so that hopefully one day no child will ever have to go through a battle with cancer. It's a beautiful cause worthy of everyone's support.

As Artistic Director of Columbia Classical Ballet I am proud to produce and direct this spectacular evening of dance for a great cause featuring incredible guest artists like:

@sarahlaneofficial
@risa10saiballet
@rkj.dance
@bradyfarrar
@ayamigoto
@grace_anne_pierce
@briangomez_24
@emilybromberg
@graceannepowers
@austin_h_powers
@matt_wiercinski

The evening will also have some of the artists of @columbiaclassicalballet

Lastly, while I am producing and directing this evening, yours truly will also be performing in this evening 😊

The gala is one night only, so 
if you live within 100 miles of Columbia, you don't want to miss this incredible celebration of dance and life! Only at the Koger Center for the Arts this April 8th, at 7:30pm. Whether you can make the performance or not, please visit the link in the profile or scan the QR code to donate to the cause. Thank you!

Sincerely,

Brooklyn Mack 
Artistic Director

